import React from "react";
import logo_1 from '../images/slider-images/1.png';

const BookList = ({ books }) => {
    // Check if books is not an array or is empty
    if (!Array.isArray(books) || books.length === 0) {
        return <div>No books to display</div>;
    }

    return (
        <>
            {books.map((item, index) => {
                let thumbnail = item.volumeInfo.imageLinks ? item.volumeInfo.imageLinks.smallThumbnail : ''; // Handle missing thumbnail
                return (
                    <div className="card" key={index}>
                        <img src={thumbnail} alt="" />
                        <div className="bottom">
                            <h3 className="title">
                                {item.volumeInfo.title}
                            </h3>
                            <p className="amt">233</p>
                        </div>
                    </div>
                );
            })}
        </>
    );
}


export default BookList;
